import { useState } from 'react'
import logo from './logo.svg';
import './App.css';
import { Link } from 'react-router-dom';

function App() {

  return (
    <>
      <h3>Welcome Page</h3>
      <Link to="/login" className='btn btn-success'>Login</Link>
      <Link to="/Register" className='btn btn-primary'>Register</Link>
    </>
  );
}

export default App;
